    const items = words.map((word, idx) =>
        <div key={idx}>{word}</div>
    );

    return (

        <div className="App">
            <h1>Amazing Recipes</h1>
            <div class="shadow">
                <div class="container">
                    <div class="card"></div>
                </div>
            </div>
        </div>

    );
}

export default Products;
